import React from 'react'
import '../css/modal.css'

function TagForm({show}) {
    return (
        <React.Fragment>
            {show && (<div className='modal'>
                <div className='modal-body'>
                    <h1>Modal window</h1>
                    <p>dsdsd</p>
                    <button onClick={() => show = false}>close</button>
                </div>
            </div>)}
        </React.Fragment>
    )
}

export default TagForm;
